import React from 'react';
import ProductCard from './ProductCard';

const ProductList = () => {
    const products = [
        { id: 1, name: "Product Name 1", price: 299, image: "../images/coverpage.jpeg" },
        { id: 2, name: "Product Name 2", price: 299, image: "../images/coverpage.jpeg" },
        { id: 3, name: "Product Name 3", price: 299, image: "../images/coverpage.jpeg" },
        { id: 4, name: "Product Name 4", price: 299, image: "../images/coverpage.jpeg" },
        { id: 5, name: "Product Name 5", price: 299, image: "../images/coverpage.jpeg" },
        { id: 6, name: "Product Name 6", price: 299, image: "../images/coverpage.jpeg" },
        { id: 7, name: "Product Name 7", price: 299, image: "../images/coverpage.jpeg" },
        { id: 8, name: "Product Name 8", price: 299, image: "../images/coverpage.jpeg" },
        { id: 9, name: "Product Name 9", price: 299, image: "../images/coverpage.jpeg" }
    ];

    return (
        <div className="cards-pg">
            {products.map(product => (
                <ProductCard key={product.id} product={product} />
            ))}
        </div>
    );
}

export default ProductList;
